function getPackages(packages = []) {
  return store.state.dependencies.filter(v => packages.includes(v.package) || packages.includes(`${v.name} ${v.version}`));
}

function writePackages(selector, packages = []) {
  if (!packages || packages.length == 0) {
    packages = store.state.dependencies
  } else {
    packages = store.state.dependencies.filter(v => packages.includes(v.package) || packages.includes(`${v.name} ${v.version}`))
  }
  let innerHTML = '';
  for (let i in packages) {
    const item = packages[i];
    innerHTML += `
    <div class="btn-group" role="group" style="margin: 0 6px 6px 0;">
      <a class="btn btn-default" target="_blank" href="${item.home}" ${!item.home ? 'disabled' : ''} >
        ${item.name} ${item.version}
      </a>
      `
    if (item.package) {
      innerHTML += `
        <a class="btn btn-default" target="_blank" href="https://www.npmjs.com/package/${item.package}" style="padding: 2px 4px;">
          <img src="./assets/svg/npm.svg" alt="" style="height: 28px;">
        </a>
      `
    }
    if (item.repository) {
      innerHTML += `<a class="btn btn-default" target="_blank" href="${item.repository}" style="padding: 2px 4px;">`
      if (item.repository.indexOf('https://github.com') === 0) {
        innerHTML += `<img src="./assets/svg/github.svg" alt="" style="height: 28px;">`;
      }
      else if (item.repository.indexOf('https://gitlab.com') === 0) {
        innerHTML += `<img src="./assets/svg/gitlab.svg" alt="" style="height: 28px;">`;
      }
      innerHTML += `</a>`;
    }
    innerHTML += `</div>`;

    selector.innerHTML = innerHTML;
  }
}